import './calendar.css';
import React from 'react';
import logo from "./IMG/Logo.jpg"
import userLogo from "./IMG/userLogo.png"

let daylist = document.querySelector(".days")
let monthName = document.querySelector(".month-name")
let year = document.querySelector(".year")
let prev = document.querySelector(".prev")
let next = document.querySelector(".next")

var dt = new Date();
var month = dt.getMonth() + 1
var years = dt.getFullYear()
var currentDay = dt.getDate()

let monthNames = ["January","Febuary","March","April","May","June","July","August","September","October","November","December"]


prev.addEventListener("click", event => {
    if(month === 1){
        month = 12
        month-=1
    }else{
        month-=1
    }
    calendarRun()
})

const calendarRun = () => {
    monthName.innerHTML = monthNames[month-1]
    yearName.innerHTML = year;
    daylist.innerHTML = ""

    daysInMonth = new Date(year, month, 0)

    for(let day = 1; day<= daysInMonth; day++ ){
        const days = document.createElement("li")
        if(days<=0){
            days.innerHTML = ""
            daylist.appendChild(days)
        } else{
            days.innerHTML = day
            daylist.appendChild(days)
        }
    }
}


function Calendar() {
    return(
        <>
            <h1 className='title'>Calendar</h1>
            <div className='calendar'>
            <div className='month'>
                <ul>
                    <li className='prev'>&#10094;</li>
                    <li className='next'>&#10095;</li>
                    <li className='month-title'>
                        <span className='month-name'>Januarary</span>
                        <br></br>
                        <span className='year'>2023</span>
                    </li>
                </ul>

            </div>      
            <ul className='weekdays'>
                <li>Mo</li>
                <li>Tu</li>
                <li>We</li>
                <li>Th</li>
                <li>Fr</li>
                <li>Sa</li>
                <li>Su</li>
            </ul>    
            <ul class="days">
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li><span className='active'>4</span></li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
            </ul>   
            </div> 
        </>

    )
}




export default Calendar;
